class ToggleFriendship{constructor(t){this.toggler=t,this.initialize()}initialize(){$(this.toggler).click((t=>{t.preventDefault();const e=this;$.ajax({type:"GET",url:$(e.toggler).attr("href")}).done((t=>{console.log(t.status);const i=t.data.status;$(e.toggler).attr("toggle-friendship-button",i),$(e.toggler).html(`${i} Friend`)})).fail((t=>{console.log("Error in completing the request")}))}))}}